import React from 'react';

import classes from './Products.module.css';

const Detail = (props) => {
  return (
    <li className={classes.product}>
      <h2>{props.title}</h2>
      <img src={props.thumbnail} alt={`Thumbnail of ${props.title}`} style={{ display: 'block', width: '100px', height: '100px' }} />
      <h3>{props.desc}</h3>
      <p>{props.price}</p>
    </li>
  );
};

export default Detail;
